  background: url("./images/home/hotel-bg.jpg") no-repeat;
  background-size: cover;
  background-attachment: fixed;
`


const Section3 = () => {

    return (
        <>
            <Blogs>

            </Blogs>
        </>
    );
}

export default Section3;
